import React, { Component } from "react";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: "",
    };
  }

  handleChange = ({ target: { value } }) => {
    this.setState({ data: value });
  };

  render() {
    return <div></div>;
  }
}
export default App;
